ISLAMABAD, Feb 9 (APP): Pakistan Muslim League (N) candidate, Raja Qamar ul Islam has won the election for National Assembly constituency NA-53, Rawalpindi-II by securing 72,006 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was Independent candidate, Ajmal Sabir Raja who bagged 58,476 votes. The votersâ€™ turn-out remained 53.07%.
